import React from 'react';
import PropTypes from 'prop-types';

// Styling
import { Box, Text } from '../../styles';
import SMenu from './styles';
import theme from '../../../theme';

const Menu = ({ isOpen }) => (
  <SMenu isOpen={isOpen}>
    <Box bg={theme.colors.black}>Test</Box>
  </SMenu>
);

Menu.propTypes = {
  isOpen: PropTypes.bool.isRequired,
};

export default Menu;
